PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?character ?age WHERE {
  VALUES ?character {
    wd:Q713701 wd:Q1057918
  }
  ?character wdt:P569 ?dateOfBirth .
  OPTIONAL {
    ?character wdt:P570 ?dateOfDeath
  }
  BIND( year( ?dateOfDeath ) - year( ?dateOfBirth ) AS ?age )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?country WHERE {
  ?country wdt:P31 wd:Q3624078 .
  FILTER NOT EXISTS {
    ?country wdt:P463 wd:Q1065 .
  }
  .
  FILTER ( ?country != wd:Q200686 ) .
  OPTIONAL {
    ?country wdt:P576 ?dissolvedDate .
  }
  FILTER ( ! BOUND( ?dissolvedDate ) ) .
  OPTIONAL {
    ?country wdt:P571 ?inceptionDate .
  }
  FILTER ( ?inceptionDate >= '1900-01-01' ^^ xsd:date ) .
  OPTIONAL {
    ?country wdt:P35 ?headOfState .
  }
  FILTER ( BOUND( ?headOfState ) )
}
LIMIT 100

