  VALUES ?castMember {
    wd:Q44870529 wd:Q49729241 wd:Q50377216 wd:Q50379405 wd:Q50379407
  }
  ?castMember rdfs:label ?castMemberLabel .
  FILTER ( LANG( ?castMemberLabel ) = 'en' ) .
  ?castMember wdt:P569 ?birthDate .
  {
    SELECT ( MIN( ?birthDate ) AS ?oldestBirthDate ) WHERE {
      VALUES ?castMember {
        wd:Q44870529 wd:Q49729241 wd:Q50377216 wd:Q50379405 wd:Q50379407
      }
      ?castMember wdt:P569 ?birthDate
    }
  }
  FILTER ( ?birthDate = ?oldestBirthDate ) .
  BIND( ?castMember AS ?oldestCastMember ) .
  BIND( ?castMemberLabel AS ?oldestCastMemberLabel )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?established WHERE {
  wd:Q220015 wdt:P571 ?established
}
